// App.js
import { useEffect, useState } from "react";
// import "./App.css";

function TableData() {
  const [data, setData] = useState([]);

  const fetchData = () => {
    fetch(`https://dummyjson.com/products`)
      .then((response) => response.json())
      .then((actualData) => {
        console.log(actualData);
        setData(actualData.products);
        console.log(data);
      })
      .catch((err) => {
        console.log(err.message);
      });
  };

  useEffect(() => {
    fetchData();
  }, []);

  return (
    <div>
      <tbody>
        <tr>
          <th>Name</th>
          <th>Brand</th>
          {/* <th>Image</th> */}
          <th>Price</th>
          <th>Rating</th>
        </tr>
        {data.map((item, index) => (
          <tr>
            <td>{item.title}</td>
            <td>{item.brand}</td>
            {/* <td>
              <img src="{item.thumbnail}" alt="" height="{100}" />
            </td> */}
            <td>{item.price}</td>
            <td>{item.rating}</td>
          </tr>
        ))}
      </tbody>
      <button onClick={() => navigate("/table-data")}>Data</button>
    </div>
  );
}

export default TableData;
